@ lib/core.asm
@ lib/types.asm
@ lib/stdlib.asm
@ lib/stdio.asm
@ lib/display.asm

# run the program then paste in the payload below

main!
  pop pop !display_buffer sts

  # wait and consume first two nibbles
  !block_any !block_any
  # offset to start of video
  xFF !delay x80 !delay

  frame_loop:
    !display_buffer for_byte:
      # assume input never empty
      # assume input always well-formed
      !getc !char.check_null :done !bcs
      !char.to_u4 x04 rot
      !getc !char.check_null :done !bcs
      !char.to_u4 orr !u8
      # write byte to display buffer
      ld1 !u8.sta
    inc !check_zero :for_byte !bcc pop

    # stall until next frame
    x02 !delay x15 !stall
  :frame_loop !jmp

  done: !hlt

payload!
  # 
